/**
 * Database script that creates modw.resourcefact
 * for testing purposes of coupling with OpenXDMoD
 */

CREATE DATABASE modw;

USE modw;

CREATE TABLE `resourcefact`
(
  `id` INT NOT NULL,
  `resourcetype_id` INT,
  `organization_id` INT,
  `name` VARCHAR(200),
  `code` VARCHAR(64) NOT NULL,
  `description` VARCHAR(1000),
  `start_date` DATETIME,
  `start_date_ts` INT DEFAULT 0 NOT NULL,
  `end_date` DATETIME,
  `end_date_ts` INT,
  PRIMARY KEY (`id`, `start_date_ts`)
);
CREATE INDEX `aggregation_index` ON `resourcefact` (`resourcetype_id`, `id`);

